import {React, useState} from 'react'
import Create from './pages/Create'
import ContentList from './pages/ContentList'
import data from './resource/dummyData'
import './App.css'

function App() {

  const [dummyData, setDummyData] = useState(data);

  const handleSubmitClick = (() => {
    const datas ={
      id: 1,
      username: 'MinWoo',
      title: '제목입니다1',
      content:
        '이 프로젝트 성공 할 수 있습니다. 여러분!!! 저도 열심히 할게요!!',
      createdAt: '2022-02-24T16:17:47.000Z',
    }
    console.log('저장 버튼 클릭')

    setDummyData([...dummyData]);
  });

  return (
    <div className='container'>
      {/* 왼쪽 목록 */}
      <div className="table">
        <div className='table-title'>
          <span>목록</span>
          <button>글쓰기</button>
        </div>
        <div className="table-title">
          <div className="tab">번호</div>
          <div className="tab">제목</div>
          <div className="tab">날짜</div>
        </div>
        <ContentList/>
      </div>
      {/* 오른쪽 Create 컴포넌트 */}
      <Create onSubmitClick = {handleSubmitClick}/>
    </div>
  )
}

export default App
